//On Page Ready Scripts To Execute

$(document).ready(function() {	
	$("#owl-home-narrow").owlCarousel({
		slideSpeed : 300,
		paginationSpeed : 400,
		singleItem:true,
		navigation: true,
		navigationText: [
		"<i class='glyphicon glyphicon-chevron-left'></i>",
		"<i class='glyphicon glyphicon-chevron-right'></i>"
		]
	});
	
	$("#owl-home-wide").owlCarousel({
		slideSpeed : 300,
		paginationSpeed : 400,
		singleItem:true,
		navigation: true,
		navigationText: [
		"<i class='glyphicon glyphicon-chevron-left'></i>",
		"<i class='glyphicon glyphicon-chevron-right'></i>"
		]
	});
	
	$("#owl-smile").owlCarousel({
		navigation : true, // Show next and prev buttons
		slideSpeed : 300,
		paginationSpeed : 400,
		singleItem:true
	});
	
	$('.gfield input').addClass('form-control');
	$('.gfield textarea').addClass('form-control');
	$('.gform_button').addClass('btn btn-primary');
	
});


